import React, { useContext, useState } from "react";
import styled from "styled-components";
import {
  NavbarBrand,
  Nav,
  NavItem,
  NavLink,
  Row,
  Card,
  Navbar,
  NavbarToggler,
  Collapse,
} from "reactstrap";
import { signinUpContext } from "../context/signinup";
import { observer } from "mobx-react-lite";
import Link from "next/link";
import styles from "./main/topNabBar.module.css";

const topnavbar = observer(() => {
  const signInfo = useContext(signinUpContext);
  const [collapsed, setCollapsed] = useState(true);

  const toggleNavbar = () => setCollapsed(!collapsed);
  const TopNavBarTitleLogoMoblie = styled.span`
    font-size: 35pt;
    text-align: center;
    width: 100%;
  `;
  const HomeTitlePosition = styled.div`
    display: flex;
    justify-content: center;
  `;
  const TopNavBarItemText = styled(Link)`
    color: #333;
    font-size: 13pt;
    font-weight: bold;
    &:hover {
      color: #333;
      text-decoration: none !important;
    }
  `;

  const logout = () => {
    signInfo.kakaoId = "";
    signInfo.name = "";
    signInfo.email = "";
    signInfo.password = "";
    signInfo.JoinOrNot = false;
  };
  const init = () => {
    /* birthInfo.dbName = "";
    birthInfo.birth_year = "";
    birthInfo.birth_total = "";
    birthInfo.birth_month = "";
    birthInfo.birth_day = "";*/
  };
  const DeleteBorder = styled(Card)`
    border: 0;
    margin: 5%;
  `;
  const TopNavbarHomePosition = styled(NavbarBrand)`
    width: 90%;
  `;
  const TopNavbarHomePositionMoblie = styled(NavbarBrand)`
    width: 80%;
  `;
  const TopNavBarTitleLogo = styled.span`
    font-size: 40pt;
    margin-left: 10%;
  `;

  const NavBarOdd = styled(NavItem)`
    background: #2bd9fd;
  `;
  const NavBarEven = styled(NavItem)`
    background: #5feefd;
  `;
  return (
    <div>
      <ul className={styles.navBack}>
        <li className={styles.nav}>
          <a className={styles.navText} href="#home">
            Home
          </a>
        </li>
        <li>
          <a className={styles.navText} href="#news">
            News
          </a>
        </li>
        <li>
          <a className={styles.navText} href="#contact">
            Contact
          </a>
        </li>
      </ul>
    </div>
  );
});

